import * as actionTypes from './action';

const initialState = {
    productInfo: '',
};

const reducer = (state = initialState, action) => {
    switch(action.type){
        case actionTypes.ADD_PRODUCT_INFO:
        console.log("I'm here")
        return {
            state
        };
        default:
        return state;
    }
} ;

export default reducer;
